export default {
  name: '',
  components: {},
  props: {
    listOne: {
      type: Array,
      default: [],
    },
  },
  data() {
    return {
      formValidate: {
        info: '',
      },
      isShow: false,
      loading: false,
      //选中信息集合
      selectEquips: [],
      columns1: [
        {
          type: 'selection',
          width: 60,
          align: 'center',
        },
        {
          title: '信息',
          key: 'info',
        },
        {
          title: '信息格式',
          key: 'label',
        },
        {
          title: '提示信息',
          key: 'tip',
        },
      ],
      listOneNew:[]
    }
  },
  computed: {},
  watch: {
    listOne:{
      handler: function(n) {
        this.listOneNew = n;
      }
    }
  },
  created() {},
  mounted() {},
  methods: {
    handleSubmit(){
      if(this.formValidate.info){
        let obj = [];
        this.listOne.forEach(item=>{
          if(item.info.indexOf(this.formValidate.info) !=-1){
            obj.push(item)
          }
        });
        this.$set(this,'listOneNew',obj);
      }else{
        this.$set(this,'listOneNew',this.listOne);
      }
    },
    selectionTap(data){
      this.selectEquips = data;
    },
    ok() {
      this.$emit('getInfoList', this.selectEquips)
      this.reset();
    },
    cancel() {
      this.isShow = false;
      this.reset();
    },
    reset(){
      this.formValidate.info = '';
      this.$refs.table.selectAll(false);
      this.listOneNew = this.listOne
    }
  },
}
